from math import gcd

def count_non_180_degree_angles(n, functions):
    iset = set()
    for (k, b) in functions:
        if k == 0:
            if b == 0:
                iset.add((0, 1))
            else:
                x = gcd(k, b)
                if k * b > 0:
                    iset.add((abs(b // x), abs(k // x)))
                else:
                    iset.add((-abs(b // x), abs(k // x)))
    return len(iset)

